import React from 'react';
import logoImage from './logo1.png'

const Navbar = () => {
  return (
    <nav className="bg-white shadow h-20"> {/* Set the height of the navbar */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 h-full">
        <div className="flex justify-between h-full items-center">
          {/* Logo on the left */}
          <a href="#" className="flex items-center">
            <img src={logoImage} alt="Logo" className="h-12" /> {/* Adjust logo height as needed */}
          </a>

          {/* Navigation Links on the right */}
          <div className="flex items-center space-x-4">
            <a href="Home" className="text-gray-700 hover:text-blue-600 px-3 py-2 rounded-md text-sm font-medium">Home</a>
            <a href="" className="text-gray-700 hover:text-blue-600 px-3 py-2 rounded-md text-sm font-medium">Chef</a>
            <a href="#" className="text-gray-700 hover:text-blue-600 px-3 py-2 rounded-md text-sm font-medium">Customer</a>
            <a href="#" className="text-gray-700 hover:text-blue-600 px-3 py-2 rounded-md text-sm font-medium">Login</a>
          </div>
        </div>
      </div>
    </nav>
  );
};
export default Navbar;
